package com.example.creatingcontainer.Model;

public class ImageNamesOnly {
private String bname;
private String kafName;
private String keyName;
private String fName;
private String spName;
public ImageNamesOnly() {
	super();
	// TODO Auto-generated constructor stub
}
public ImageNamesOnly(String bname, String kafName, String keyName, String fName, String spName) {
	super();
	this.bname = bname;
	this.kafName = kafName;
	this.keyName = keyName;
	this.fName = fName;
	this.spName = spName;
}
public String getBname() {
	return bname;
}
public void setBname(String bname) {
	this.bname = bname;
}
public String getKafName() {
	return kafName;
}
public void setKafName(String kafName) {
	this.kafName = kafName;
}
public String getKeyName() {
	return keyName;
}
public void setKeyName(String keyName) {
	this.keyName = keyName;
}
public String getfName() {
	return fName;
}
public void setfName(String fName) {
	this.fName = fName;
}
public String getSpName() {
	return spName;
}
public void setSpName(String spName) {
	this.spName = spName;
}

}
